GM_addStyle ( `

    #destinatario {
        font-size: 30px !important;
    }
    .texto {
        font-size: 30px !important;
    }
    #logocliente {
        display: none!important;
    }
    .ocultoimpresion {
        display: none!important;
    }
    #superior {
        display: none!important;
    }
    #lateralizq1 {
        display: none!important;
    }
    #lateralizq2 {
        display: none!important;
    }
    #lateralder1 {
        display: none!important;
    }
    #lateralder2 {
        display: none!important;
    }
    #footer {
        display: none!important;
    }
    #textocliente {
        display: none!important;
    }
    .separador {
        padding-top: 55px!important;
        display: none;
    }
    #destinatario {
        width: fit-content!important;
        margin-top: 0.4 em;
        padding: 0!important;
        font-family: 'Roboto',sans - serif;
    }
    .texto {
        margin-top: 0.4em!important;
        margin-bottom: 0.4em!important;
        font-family: 'Roboto', sans-serif;
    }
    #tablacertificado {
        display: flex;
        justify-content: center;
        align-items: center;
        width: 700px!important;
        height: 434px!important;
    }
    #logopf {
        width: 620;
        margin-left: -15!important;
        margin-top: -40px;
    }

` );

$(document).ready(function(){
    $("#logopf").attr("src", "data:image/png;base64,");
    $("#codigobarras > img").css("image-rendering", "pixelated");
    $("center").css("width", "fit-content");
    $("body").css({
        "width": "fit-content",
        "height": "fit-content",
        "box-shadow": "rgb(0 0 0) 0px 0px 0px 1px inset",
        "border-radius": "3px"
    });
    $("#codigobarras > img").css({
        "width": "434px"
    });
    $("tbody").first().addClass("container-t")
    $(".container-t").css({
        "display": "flex",
        "flex-direction": "column",
        "align-items": "center",
        "margin-top": "-8px"
    });
    $("center > table > tbody > tr > td > table > tbody").addClass("container-s")
    $(".container-s").css({
        "display": "flex",
        "flex-direction": "column",
        "align-items": "center",
        "margin-top": "-40px",
        "margin-left": "-5px"
    });
    $("head").append('<link href="https://fonts.googleapis.com/css2?family=Roboto&display=swap" rel="stylesheet">');
});